import React from "react";
import { useQuery, gql } from "@apollo/client";

const GET_SHIPMENTS = gql`
  query ($id: ID!) {
    user(id: $id) {
      shipments {
        id
        waybill
      }
    }
  }
`;

const MyShipments = () => {
  const {
    state: { size2, time, usersPerDate },
    actions: { getAllUsers, average, setTime },
  } = useContext(AdminContext);

  const { error, data, loading } = useQuery(GET_SHIPMENTS, {
    variables: {
      id: 2,
    },
  });

  if (loading) {
    return <p>Loading...</p>;
  }
  return (
    <div>
      {data.user.shipments &&
        data.user.shipments.map((shipment, key) => (
          <p key={key}>{shipment.id}</p>
        ))}
    </div>
  );
};

export default MyShipments;
